import { Link } from "react-router-dom";

const menuContent = [
  {
    name: "Home",
    activeClass: "sf-with-ul",
    menuClass: "",
    routerPath: "/home-default",
    dropDownItems: [
    ],
  },
  {
    name: "Portfolio",
    activeClass: "",
    menuClass: "",
    routerPath: "/works-grid",
    dropDownItems: [
    ],
  },
  {
    name: "Blog",
    activeClass: "",
    menuClass: "",
    routerPath: "/blog-grid",
    dropDownItems: [
    ],
  },
  {
    name: "About",
    activeClass: "",
    menuClass: "",
    routerPath: "/about-me",
    dropDownItems: [
    ],
  },
];

const DropdownMenu = () => {
  return (
    <ul className="sf-menu">
      {item.menuContent.map((item, i) => (
        <li className={`menu-item-has-children ${item.menuClass}`} key={i}>
          <Link to={val.routerPath}>
                  {" "}
                  <span>{val.name}</span>
                </Link>

          {/* <ul className="sub-menu mega">
            {item.dropDownItems.map((val, i) => (
              <li key={i}>
                <Link to={val.routerPath}>
                  {" "}
                  <span>{val.name}</span>
                </Link>
              </li>
            ))}
          </ul> */}
        </li>
      ))}
    </ul>
  );
};

export default DropdownMenu;
